import returnSearch from "./returnSearch"

export default function getSearch(getDeviceData, getUserData, getDidData, string, filteredSearch, ret=['Device', 'User', 'Did']) {
  let temp = {}

  ret.forEach(e => {
    switch(e) {
      case "Device": temp[e.toLocaleLowerCase()] = returnSearch(getDeviceData), string.target.value.toLocaleLowerCase(), filteredSearch.device.results
      case "User": temp[e.toLocaleLowerCase()] = returnSearch(getUserData), string.target.value.toLocaleLowerCase(), filteredSearch.user.results
      case "Did": temp[e.toLocaleLowerCase()] = returnSearch(getDidData), string.target.value.toLocaleLowerCase(), filteredSearch.did.results
      default: /*pass*/
    }

    return temp
  })

